import React from "react";
import  ReactDOM  from "react-dom";
import { responsive } from "./responsive.js";
import {S2} from './S2.js'
export class DBMS_header extends React.Component{
    constructor(){
        super()
        let arr1=['process','threads']
        this.state=({arr:arr1,style:responsive.DBMS()});
        this.resize=this.resize.bind(this)
        window.addEventListener('resize',this.resize)
    }
    resize(){
        this.setState((prev)=>{return {arr:prev.arr,style:responsive.DBMS()}})
    }
    render(){
        return(
            <div style={this.state.style}> 
                <S2 main={"DBMS"} topics={this.state.arr}/>
            </div>
        )
    }
}
